INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (2, 2, 102301, "アヤネ", 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24001, 401);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 2, 102301, "アヤネ", 2.21, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24002, 402);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (2, 2, 102301, "アヤネ", 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24003, 403);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (2, 1, 192201, "アサヒ", 1.99, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24004, 701);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 2, 192201, "アサヒ", 2.21, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24005, 702);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (2, 1, 192201, "アサヒ", 3.33, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24006, 703);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (2, 2, 192301, "部員３", 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24007, 801);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 2, 192301, "部員３", 2.68, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24008, 802);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (2, 2, 192301, "部員３", 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24009, 803);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 1, 192501, "", 0.0, "やった！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24010, 501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 1, 192501, "", 0.0, "勝ったよ！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24011, 502);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 1, 192501, "", 0.0, "いい調子！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24012, 503);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (6, 2, 113501, "ミサト", 5.33, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24013, 111);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 2, 113501, "ミサト", 6.85, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24014, 112);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 2, 113501, "ミサト", 3.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24015, 113);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 2, 192401, "ダイチ", 6.11, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24016, 611);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 2, 192401, "ダイチ", 6.75, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24017, 612);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (2, 2, 192401, "ダイチ", 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24018, 613);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (2, 1, 113401, "ハツネ", 4.52, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24019, 211);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (2, 1, 113401, "ハツネ", 3.89, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24020, 212);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 2, 113401, "ハツネ", 13.49, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24021, 213);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 2, 106501, "カヤ", 3.17, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24022, 311);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 2, 106501, "カヤ", 4.42, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24023, 312);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (6, 1, 106501, "カヤ", 2.89, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24024, 313);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (4, 3, 102301, "アヤネ", 3.71, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24025, 421);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (2, 1, 192201, "アサヒ", 5.1, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24026, 721);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 3, 192301, "部員３", 4.34, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24027, 821);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 1, 192501, "", 0.0, "いい勝負だったよ\nまたやろうね", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 0.0, 24028, 521);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 2, 113501, "ミサト", 5.62, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, -360.0, 24029, 101);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 2, 113501, "ミサト", 9.58, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, -360.0, 24030, 102);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (2, 2, 113501, "ミサト", 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, -360.0, 24031, 103);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (2, 1, 113501, "ミサト", 9.13, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, -360.0, 24032, 104);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (1, 2, 113501, "ミサト", 8.27, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 24, -360.0, 24033, 105);
